export class LocationSearching {
  constructor() {
    this.latitude = 0;
    this.longitude = 0;
    this.address = '';
  }

  deserialize(input) {
    Object.assign(this, input);
    return this;
  }

  update(lat, longtitude, address) {
    this.latitude = lat;
    this.longitude = longtitude;
    this.address = address;
    return this;
  }

  isEmpty() {
    return !this.longitude || !this.latitude || !this.address;
  }

}
